INSERT INTO `cadssub` (`cod_subcad`, `nom_subcad`, `nom_subcadING`, `cod_cad`, `informacionESP`, `informacionING`) VALUES
(111, 'Educación, nivel no especificado', 'Education, level unspecified', 110, 'Se aplicará esta categoría cuando se desconozca el nivel educativo correspondiente a un determinado proyecto.', 'The codes in this category are to be used only when level of education is unspecified or unknown (e.g. training of primary school teachers should be coded under 11220).'),
