(113, 'Educación secundaria', 'Secondary education', 110, NULL, NULL),
(114, 'Educación post-secundaria', 'Post-secondary education', 110, NULL, NULL),
(121, 'Salud, en general', 'Health, general', 120, NULL, NULL),
(122, 'Salud básica', 'Basic health', 120, NULL, NULL),
(130, 'PROGRAMAS SOBRE POBLACIÓN Y SALUD REPRODUCTIVA', 'POPULATION POLICIES/PROGRAMMES AND REPRODUCTIVE HEALTH', 130, NULL, NULL),
(140, 'DEPURACIÓN Y SUMINISTRO DE AGUA', 'WATER SUPPLY AND SANITATION', 140, NULL, NULL),
(151, 'Gobierno y Sociedad Civil, general', 'Government and civil society, general', 150, 'N.B. Utilice el código 51010 para el apoyo presupuestario general.', 'N.B. Use code 51010 for general budget support.'),
(152, 'Prevención y resolución de conflictos, paz y seguridad', 'Conflict prevention and resolution, peace and security', 150, 'NOTA Otras notas sobre el cómputo de AOD (y exclusiones) de procesos de consolidación de paz tras los conflictos y de las actividades relacionadas con la seguridad se explican  en el APÉNDICE.', 'N.B.  Further notes on ODA eligibility (and exclusions) of conflict, peace and security related activities are given in paragraph 39 of the DAC Statistical Reporting Directives.'),
(160, 'OTROS SERVICIOS E INFRAESTRUCTURAS SOCIALES', 'OTHER SOCIAL INFRASTRUCTURE AND SERVICES', 160, NULL, NULL),
(162, 'Política de empleo', 'Employment policy', 160, NULL, NULL),
(163, 'Ayuda multisectorial', 'Multisector aid', 160, NULL, NULL),
(210, 'TRANSPORTE Y ALMACENAMIENTO', 'TRANSPORT AND STORAGE', 210, 'La fabricación de equipos transporte debe incluirse en \"Sectores productivos\". (Código 32172).', 'Note: Manufacturing of transport equipment should be included under code 32172.'),
(220, 'COMUNICACIONES', 'COMMUNICATION', 220, NULL, NULL),
(230, 'Generación y Suministro de ENERGÍA', 'ENERGY GENERATION AND SUPPLY', 230, NULL, NULL),
(240, 'SERVICIOS BANCARIOS Y FINANCIEROS', 'BANKING AND FINANCIAL SERVICES', 240, NULL, NULL),
(250, 'NEGOCIOS COMERCIALES Y OTROS SERVICIOS', 'BUSINESS AND OTHER SERVICES', 250, NULL, NULL),
(311, 'Agricultura', 'Agriculture', 310, NULL, NULL),
