(322, 'Industrias extractivas', 'Mineral resources and mining', 320, NULL, NULL),
(323, 'Construcción', 'Construction', 320, NULL, NULL),
(331, 'Política y regulación comercial', 'TRADE POLICY AND REGULATIONS AND TRADE-RELATED ADJUSTMENT', 330, NULL, NULL),
(332, 'Turismo', 'Tourism', 330, NULL, NULL),
(400, 'Multisectorial', 'MULTISECTOR/CROSS-CUTTING', 400, NULL, NULL),
(410, 'Protección del medio ambiente', 'General environmental protection', 410, NULL, NULL),
(430, 'Otros multisectorial', 'Other multisector', 430, NULL, NULL),
(500, 'AYUDA EN FORMA DE SUMINISTRO DE BIENES Y ayuda general para programas', 'COMMODITY AID AND GENERAL PROGRAMME ASSISTANCE', 500, 'Nota: la ayuda para programas de sectores específicos debe incluirse en el correspondiente sector, empleando el indicador de programa sectorial cuando proceda.', 'Note: Sector specific programme assistance is to be included in the respective sectors, using the sector programme flag if appropriate.'),
(510, 'Apoyo presupuestario general', 'General budget support', 510, 'El apoyo presupuestario en forma de enfoques sectoriales (SWAp) deberá incluirse en los sectores correspondientes.', 'Budget support in the form of sector-wide approaches (SWAps) should be included in the respective sectors.'),
(520, 'Ayuda alimentaria para el desarrollo / Ayuda a la  seguridad alimentaria', 'Developmental food aid/Food security assistance', 520, NULL, NULL),
(530, 'Otras ayudas en forma de suministro de bienes', 'Other commodity assistance', 530, 'Ayuda en forma de productos no alimentarios (cuando no se especifique el sector beneficiario)', 'Non-food commodity assistance (when benefiting sector not specified)'),
(600, 'Actividades relacionadas con la DEUDA', 'ACTION RELATING TO DEBT', 600, NULL, NULL),
(700, 'Ayuda humanitaria', 'Humanitarian aid', 700, 'Dentro de la definición de AOD, la ayuda humanitaria etá diseñada para ahorrar vidas, para aliviar el sufrimiento y para mantener y proteger dignidad humana durante y en las consecuencias de emergencias. Para ser clasificada como humanitaria, la ayuda debe ser constante con los principios humanitarios de la humanidad, de la imparcialidad, de la neutralidad y de la independencia.', 'Within the overall definition of ODA, humanitarian aid is assistance designed to save lives, alleviate suffering and maintain and protect human dignity during and in the aftermath of emergencies.  To be classified as humanitarian, aid should be consistent with the humanitarian principles of humanity, impartiality, neutrality and independence.'),
(720, 'Ayudas de emergencia', 'Emergency response', 720, 'Todo tipo de ayuda de emergencia, ante catástrofes y desastres naturales producidos por el hombre.', 'An emergency is a situation which results from man made crises and/or natural disasters.'),
(730, 'Ayuda a la reconstrucción y rehabilitación', 'Reconstruction relief and rehabilitation', 730, 'Esto se relaciona con las actividades durante y en las consecuencias de una situación de emergencia. Las actividades de más largo plazo para mejorar el nivel de la infraestructura o de los servicios sociales se deben asignar bajo códigos económicos y sociales relevantes del sector.', 'This relates to activities during and in the aftermath of an emergency situation.  Longer-term activities to improve the level of infrastructure or social services should be reported under the relevant economic and social sector codes. See also guideline on distinguishing humanitarian from sector-allocable aid.'),
(740, 'Prevención de desastres', 'Disaster prevention and preparedness', 740, 'Vease los códigos 41050 y 15220 para la prevención de inundaciones y de conflictos.', 'See codes 41050 and 15220 for prevention of floods and conflicts.'),
(910, 'Costes administrativos donantes', 'ADMINISTRATIVE COSTS OF DONORS', 910, NULL, NULL),
(920, 'Apoyo a organizaciones no gubernamentales (ONG)', 'Support to non-governmental organisations (NGOs)', 920, 'Recursos del sector público destinados a agencias privadas de voluntarios nacionales e internacionales, para uso discrecional de éstas.', 'Official funds to be paid over to national and international private voluntary agencies for use at the latters’ discretion.'),
(930, 'AYUDA A REFUGIADOS EN EL PAÍS DONANTE', 'REFUGEES IN DONOR COUNTRIES', 930, NULL, NULL),
(998, 'SIN ASIGNAR/SIN ESPECIFICAR', 'UNALLOCATED/  UNSPECIFIED', 990, NULL, NULL);
