INSERT INTO `crss` (`cod_crs`, `nom_crs`, `nom_crsIngles`, `cod_cadsub`, `informacionesESP`, `informacionesING`) VALUES
(11110, 'Política educativa y gestión administrativa', 'Education policy and administrative management', 111, 'Programación y planificación de la ayuda al sector educativo, ayuda a ministerios de educación, asesoramiento, fortalecimiento institucional, desarrollo planes de estudio, actividades educativas sin especificar.', 'Education sector policy, planning and programmes; aid to education ministries, administration and management systems; institution capacity building and advice; school management and governance; curriculum and materials development; unspecified education activities.'),
(11120, 'Equipamiento educativo y servicios educativos complementarios', 'Education facilities and training', 111, 'Edificios, equipos, materiales para la enseñanza, servicios complementarios.', 'Educational buildings, equipment, materials; subsidiary services to education (boarding facilities, staff housing); language training; colloquia, seminars, lectures, etc.'),
(11130, 'Formación de profesores', 'Teacher training', 111, NULL, 'Teacher education (where the level of education is unspecified); in-service and pre-service training; materials development.'),
(11181, 'Investigación educativa', 'Educational research', 111, NULL, 'Research and studies on education effectiveness, relevance and quality; systematic evaluation and monitoring.'),
(11220, 'Educación primaria', 'Primary education', 112, 'Enseñanza general elemental; material escolar.', 'Formal and non-formal primary education for children; all elementary and first cycle systematic instruction; provision of learning materials.'),
(11230, 'Educación no académica', 'Basic life skills for youth and adults ', 112, 'Alfabetización y aprendizaje de cálculo, educación para una mejor calidad de vida para adultos y niños.', 'Formal and non-formal education for basic life skills for young people and adults (adults education); literacy and numeracy training.'),
(11240, 'Educación preescolar', 'Early childhood education', 112, 'Jardines de infancia.', 'Formal and non-formal pre-school education.'),
(11320, 'Educación secundaria', 'Secondary education', 113, 'Enseñanza secundaria general en todos sus ciclos.', 'Second cycle systematic instruction at both junior and senior levels.'),
(11330, 'Formación profesional y vocacional', 'Vocational training', 113, 'Formación profesional básica y enseñanza técnica a nivel secundario; formación en el puesto de trabajo; formación de aprendices; se incluye formación profesional no académica', 'Elementary vocational training and secondary level technical education; on-the job training; apprenticeships; including informal vocational training.'),
(11420, 'Educación universitaria', 'Higher education', 114, 'Diplomas universitarios, de enseñanza superior, de tecnología; becas, bolsas de estudio.', 'Degree and diploma programmes at universities, colleges and polytechnics; scholarships.'),
(11430, 'Formación profesional avanzada', 'Advanced technical and managerial training', 114, 'Formación profesional superior y formación en el puesto de trabajo. Programas de formación profesional para trabajadores y formación de empleados', 'Professional-level vocational training programmes and in-service training.'),
(12110, 'Política sanitaria y gestión administrativa', 'Health policy and administrative management', 121, 'Política de sanidad, ayuda para la planificación y la programación; ayuda a ministerios de sanidad; administración de la sanidad pública; fortalecimiento institucional, asesoramiento; programas cobertura y seguro médico; actividades sanidad sin especificar.', 'Health sector policy, planning and programmes; aid to health ministries, public health administration; institution capacity building and advice; medical insurance programmes; unspecified health activities.'),
(12181, 'Educación, formación médicas', 'Medical education/training', 121, 'Enseñanza médica y formación para servicios nivel terciario.', 'Medical education and training for tertiary level services.'),
(12182, 'Investigación médica', 'Medical research', 121, 'Investigación médica (con exclusión de la investigación sobre la sanidad básica).', 'General medical research (excluding basic health research).'),
(12191, 'Equipos, servicios médicos', 'Medical services', 121, 'Laboratorios, clínicas especializadas y hospitales, ambulancias, servicios dentales, sanidad mental, rehabilitación médica, control enfermedades no infecciosas, control abuso medicamentos, drogas [se excluye control tráfico de narcóticos: (16361)].', 'Laboratories, specialised clinics and hospitals (including equipment and supplies); ambulances; dental services; mental health care; medical rehabilitation; control of non-infectious diseases; drug and substance abuse control [excluding narcotics traffic control (16063)].'),
(12220, 'Atención sanitaria básica', 'Basic health care', 122, 'Programas de asistencia sanitaria básica; servicios paramédicos y de enfermería; suministro de medicamentos y vacunas.', 'Basic and primary health care programmes; paramedical and nursing care programmes; supply of drugs, medicines and vaccines related to basic health care.'),
(12230, 'Infraestructura sanitaria básica', 'Basic health infrastructure', 122, 'Hospitales regionales, clínicas, dispensarios y equipamiento médico; se excluyen los hospitales y clínicas especializadas (12191).', 'District-level hospitals, clinics and dispensaries and related medical equipment; excluding specialised hospitals and clinics (12191).'),
(12240, 'Nutrición', 'Basic nutrition', 122, 'Programas para la alimentación (alimentación materna, lactancia y alimentación destete, alimentación infantil, alimentación escolar); identificación deficiencias nutritivas; suministro de vitamina A, yodo, hierro, etc.; cuidado de las condiciones de nutrición; enseñanza de la nutrición y de la higiene alimentaria; alimentación de la familia.', 'Direct feeding programmes (maternal feeding, breastfeeding and weaning foods, child feeding, school feeding); determination of micro-nutrient deficiencies; provision of vitamin A, iodine, iron etc.; monitoring of nutritional status; nutrition and food hygiene education; household food security.'),
(12250, 'Control enfermedades infecciosas', 'Infectious disease control', 122, 'Vacunación; prevención y lucha contra el paludismo, tuberculosis, diarreas crónicas, enfermedades transmitidas por un vector-agente portador (por ejemplo: oncocercosis y bilharziosis).', 'Immunisation; prevention and control of infectious and parasite diseases, except malaria (12262), tuberculosis (12263), HIV/AIDS and other STDs (13040). It includes diarrheal diseases, vector-borne diseases (e.g. river blindness and guinea worm), viral diseases, mycosis, helminthiasis, zoonosis, diseases by other bacteria and viruses, pediculosis, etc.'),
(12261, 'Educación sanitaria', 'Health education', 122, 'Información, educación y formación de la población para la mejora del nivel de conocimientos y prácticas sanitarias; campañas de sanidad pública y programas de sensibilización.', 'Information, education and training of the population for improving health knowledge and practices; public health and awareness campaigns. '),
(12262, 'Control de la malaria', 'Malaria control', 122, 'Prevención y control de la malaria', 'Prevention and control of malaria.'),
(12263, 'Control de la tuberculosis', 'Tuberculosis control', 122, 'Inmunización, prevención y control de la tuberculosis.', 'Immunisation, prevention and control of tuberculosis.'),
(12281, 'Formación personal sanitario', 'Health personnel development', 122, 'Formación de personal sanitario para asistencia sanitaria básica.', 'Training of health staff for basic health care services.'),
(13010, 'Política sobre población y gestión administrativa', 'Population policy and administrative management', 130, 'Se incluye la recogida y análisis de datos demográficos (censo, registro de nacimientos y fallecimientos, datos inmigración y emigración); actividades de población sin especificar.', 'Population/development policies; census work, vital registration; migration data; demographic research/analysis; reproductive health research; unspecified population activities.'),
(13020, 'Salud reproductiva', 'Reproductive health care', 130, 'Promoción salud reproductiva; cuidados preparto y postparto; actividades para maternidad sin riesgos; incluyendo cuidados en materia de fertilidad (prevención y tratamiento de la infertilidad; prevención y gestión consecuencias del aborto) pero excluyendo planificación familiar (13030).', 'Promotion of reproductive health; prenatal and postnatal care including delivery; prevention and treatment of infertility; prevention and management of consequences of abortion; safe motherhood activities.'),
(13030, 'Planificación familiar', 'Family planning', 130, 'Consejos de planificación familiar; actividades de información, educación y comunicación (IEC); distribución de anticonceptivos.', 'Family planning services including counselling; information, education and communication (IEC) activities; delivery of contraceptives; capacity building and training.'),
(13040, 'Lucha contra ETS (enfermedades de transmisión sexual), incluido el SIDA', 'STD control including HIV/AIDS', 130, 'Todas las actividades relacionadas con enfermedades de transmisión sexual y con el control del SIDA, como información, educación y comunicación; diagnóstico precoz; prevención; tratamiento; cuidados; investigación.', 'All activities related to sexually transmitted diseases and HIV/AIDS control e.g. information, education and communication; testing; prevention; treatment, care.'),
(13081, 'Formación de personal para población y salud reproductiva', 'Personnel development for population and reproductive health', 130, 'Educación y formación de personal sanitario para servicios de población y salud reproductiva.', 'Education and training of health staff for population and reproductive health care services.'),
(14010, 'Política recursos hidrológicos y gestión administrativa', 'Water resources policy and administrative management', 140, 'Política de recursos hidrológicos; ayuda a la planificación y programación; legislación y gestión; fortalecimiento de instituciones, consejo; evaluación y estudios de recursos hidrológicos; aguas subterráneas, estudios sobre la calidad del agua y sobre las cuencas hidrográficas; hidrogeología; se excluyen los recursos hidrológicos para uso agrícola (31140).', 'Water sector policy, planning and programmes; water legislation and management; institution capacity building and advice; water supply assessments and studies; groundwater, water quality and watershed studies; hydrogeology; excluding agricultural water resources (31140).'),
(14015, 'Protección recursos hidrológicos', 'Water resources protection', 140, 'Agua dulce de superficie (ríos, lagos, etc.), preservación y rehabilitación de aguas subterráneas; lucha contra la contaminación del agua por productos químicos agrícolas, vertidos industriales.', 'Inland surface waters (rivers, lakes, etc.); conservation and rehabilitation of ground water; prevention of water contamination from agro-chemicals, industrial effluents.'),
(14020, 'Suministro de agua y saneamiento', 'Water supply and sanitation - large systems', 140, 'Desalinizadoras; alcantarillado; plantas para tratamiento aguas residuales (de viviendas e industriales). Suministro de agua y saneamiento, excluyendo sector 14030.', 'Water desalination plants; intakes, storage, treatment, pumping stations, conveyance and distribution systems; sewerage; domestic and industrial waste water treatment plants. '),
(14030, 'Técnicas abaratamiento suministro agua, depuración, alcantarillado', 'Basic drinking water supply and basic sanitation', 140, 'Suministro de agua y saneamiento utilizando tecnologías de bajo coste tales como bombas manuales para extracción de agua, sistemas de suministro de agua por acción de la gravedad, aljibes, letrinas.', 'Water supply and sanitation through low-cost technologies such as handpumps, spring catchment, gravity-fed systems, rain water collection, storage tanks, small distribution systems; latrines, small-bore sewers, on-site disposal (septic tanks).'),
(14040, 'Desarrollo cuencas fluviales', 'River development', 140, 'Proyectos de cuencas fluviales; regulación corrientes de agua; presas, embalses, con exclusión de presas para regadíos (31140) e hidroeléctricas (23065) y actividades relacionadas con el transporte fluvial (21040).', 'Integrated river basin projects; river flow control; dams and reservoirs [excluding dams primarily for irrigation (31140) and hydropower (23065) and activities related to river transport (21040)]. '),
(14050, 'Tratamiento residuos sólidos', 'Waste management/disposal', 140, 'Tratamiento de residuos sólidos municipales e industriales, incluyendo residuos tóxicos.', 'Municipal and industrial solid waste management, including hazardous and toxic waste; collection, disposal and treatment; landfill areas; composting and reuse.'),
(14081, 'Educación y formación en abastecimiento de agua y saneamiento', 'Education and training in water supply and sanitation ', 140, NULL, NULL),
(15110, 'Planificación económica y de desarrollo.', 'Public sector policy and administrative management', 151, 'Política y planificación macroeconómicas, fiscales y monetarias; planificación social, análisis económico y social; reformas estructurales; planificación para el desarrollo; apoyo a ministerios responsables de la coordinación de la ayuda; otros ministerios cuando el sector no puede ser determinado.', 'Institution-building assistance to strengthen core public sector management systems and capacities. This includes macro-economic and other policy management, co-ordination, planning and reform; human resource management; organisational development; civil service reform; e‑government; development planning, monitoring and evaluation; support to ministries involved in aid co-ordination; other ministries and government departments when sector cannot be specified. (Use specific sector codes for development of systems and capacities in sector ministries.)'),
(15111, 'Gestión financiera sector público', 'Public finance management', 151, 'Fortalecimiento de la contabilidad financiera y gerencial; gestión del gasto público; mejora de sistemas de gestión financiera; política fiscal y administración; procedimientos de cálculo de los ingresos imponibles; elaboración de presupuestos; auditoría sobre el terreno; medidas contra el despilfarro, el fraude y la corrupción, la deuda pública. (Use el código 33120 para las aduanas).', 'Fiscal policy and planning; support to ministries of finance; strengthening financial and managerial accountability; public expenditure management; improving financial management systems; tax policy and administration; budget drafting; inter-governmental fiscal relations, public audit, public debt. (Use code 33120 for customs.)'),
(15112, 'Descentralización y apoyo a los gobiernos regionales y locales', 'Decentralisation and support to subnational government', 151, 'Los procesos de descentralización (incluyendo las dimensiones política, administrativa y fiscal), las relaciones intergubernamentales y el federalismo, el fortalecimiento de los departamentos de los gobiernos regionales y locales, autoridades regionales y locales y sus asociaciones nacionales. (Utilice los códigos sectoriales específicos para la descentralización de la gestión del sector y los servicios.)', 'Decentralisation processes (including political, administrative and fiscal dimensions); intergovernmental relations and federalism; strengthening departments of regional and local government, regional and local authorities and their national associations. (Use specific sector codes for decentralisation of sector management and services.) '),
(15113, 'Organizaciones de lucha contra la corrupción de las instituciones.', 'Anti-corruption organisations and institutions ', 151, 'Las organizaciones especializadas, instituciones y marcos para la prevención y la lucha contra la corrupción, el soborno, el blanqueo de dinero y otros aspectos de la delincuencia organizada, con o sin competencias de aplicación de la ley, por ejemplo, las comisiones contra la corrupción y los órganos de vigilancia, los servicios especiales de investigación, instituciones e iniciativas de la integridad y la ética de supervisión, las ONG especializadas, la sociedad civil y organizaciones directamente relacionadas con la corrupción de los ciudadanos.', 'Specialised organisations, institutions and frameworks for the prevention of and combat against corruption, bribery, money-laundering and other aspects of organised crime, with or without law enforcement powers, e.g. anti-corruption commissions and monitoring bodies, special investigation services, institutions and initiatives of integrity and ethics oversight, specialised NGOs, other civil society and citizens’ organisations directly concerned with corruption.'),
(15130, 'Desarrollo legal y judicial', 'Legal and judicial development', 151, 'Apoyo a las instituciones, sistemas y procedimientos del sector judicial, tanto formales como informales, el apoyo a los ministerios de Justicia, Interior y Asuntos de Interior, jueces y tribunales, servicios jurídicos; asociaciones de abogados, enseñanza y formación en materia jurídica, el mantenimiento de la ley y orden y seguridad pública; gestión de las fronteras, las agencias de aplicación de la ley, la policía, las prisiones y su supervisión, los defensores del pueblo, la resolución alternativa de conflictos, arbitraje y mediación, asistencia jurídica y letrada; tradicionales, indígenas y prácticas paralegales que quedan fuera del sistema legal formal. Medidas que favorezcan la mejora de los marcos jurídicos, constituciones, leyes y reglamentos legislativos y constitucionales de redacción y revisión, la reforma jurídica, la integración de los sistemas formales e informales de la ley. La educación pública legal, la difusión de información sobre los derechos y recursos de la injusticia, las campañas de sensibilización. (Utilice los códigos 152xx para las actividades que están dirigidas fundamentalmente a apoyar la reforma del sistema de seguridad o realizadas en relación con el post-conflicto y las actividades de construcción de la paz.)', 'Support to institutions, systems and procedures of the justice sector, both formal and informal; support to ministries of justice, the interior and home affairs; judges and courts; legal drafting services; bar and lawyers associations; professional legal education; maintenance of law and order and public safety; border management; law enforcement agencies, police, prisons and their supervision; ombudsmen; alternative dispute resolution, arbitration and mediation; legal aid and counsel; traditional, indigenous and paralegal practices that fall outside the formal legal system.\n\nMeasures that support the improvement of legal frameworks, constitutions, laws and regulations; legislative and constitutional drafting and review; legal reform; integration of formal and informal systems of law.\n\nPublic legal education; dissemination of information on entitlements and remedies for injustice; awareness campaigns. \n\n(Use codes 152xx for activities that are primarily aimed at supporting security system reform or undertaken in connection with post-conflict and peace building activities.)\n'),
(15150, 'La participación democrática y la sociedad civil', 'Democratic participation and civil society', 151, 'Apoyo al ejercicio de la democracia y las diversas formas de participación de los ciudadanos más allá de los procesos electorales (15161), los instrumentos de democracia directa, tales como los referendos y las iniciativas de los ciudadanos, el apoyo a las organizaciones para representar y defender a sus miembros, para vigilar, participación en la planificación de los y en la toma de decisiones de los gobiernos para que rindan cuentas , y para ayudar a los ciudadanos aprender a actuar en la esfera pública, los planes de estudio y la enseñanza de la educación cívica en diversos niveles. (Este código se limita a actividades destinadas a cuestiones de gobernanza. Cuando la asistencia de la sociedad civil sea sin fines de gobierno use otros códigos más apropiados. Use códigos 920xx de apoyo básico a las ONG.)', 'Support to the exercise of democracy and diverse forms of participation of citizens beyond elections (15151); direct democracy instruments such as referenda and citizens’ initiatives; support to organisations to represent and advocate for their members, to monitor, engage and hold governments to account, and to help citizens learn to act in the public sphere; curricula and teaching for civic education at various levels. (This purpose code is restricted to activities targeting governance issues. When assistance to civil society is for non-governance purposes use other appropriate purpose codes. Use codes 920xx for core support to NGOs.)'),
(15151, 'Procesos electorales', 'Elections', 151, 'Apoyo y supervisión en procesos electorales, observaciones electorales, educación cívica de electores [que no correspondan a operaciones de consolidación de la paz (15230)', 'Electoral management bodies and processes, election observation, voters\' education. (Use code 15230 when in connection with UN post-conflict peace-building.)'),
(15152, 'Legislaturas y partidos políticos', 'Legislatures and political parties', 151, 'Asistencia para fortalecer las funciones clave de las legislaturas o parlamentos como las asambleas y consejos subnacionales (representación, supervisión, legislación), la mejora de la capacidad de los órganos legislativos, la mejora de los comités legislativos y de procedimientos administrativos, la investigación y los sistemas de gestión de la información, la prestación de programas de formación para los legisladores y personal de apoyo. Asistencia a los partidos políticos y el fortalecimiento de los sistemas de partidos.', 'Assistance to strengthen key functions of legislatures/ parliaments including subnational assemblies and councils (representation; oversight; legislation), such as improving the capacity of legislative bodies, improving legislatures’ committees and administrative procedures,; research and information management systems; providing training programmes for legislators and support personnel. Assistance to political parties and strengthening of party systems.'),
(15153, 'Medios de comunicación y el libre flujo de información', 'Media and free flow of information', 151, 'Actividades que apoyan el flujo de información sobre asuntos públicos libre y sin censura, y las actividades que aumentan la edición y los conocimientos técnicos y la integridad de los medios impresos y electrónicos, por ejemplo, formación de periodistas. (Utilice los códigos 22010-22040 para la provisión de equipos y asistencia de capital a los medios de comunicación.)', 'Activities that support free and uncensored flow of information on public issues; activities that increase the editorial and technical skills and the integrity of the print and broadcast media, e.g. training of journalists. (Use codes 22010-22040 for provision of equipment and capital assistance to media.)'),
(15160, 'Derechos humanos', 'Human rights', 151, 'Medidas de apoyo oficial especializado de derechos humanos y mecanismos universales, regionales, nacionales y locales en sus papeles legales para promover y proteger los derechos civiles y políticos, económicos, sociales y culturales, tal como se definen en las convenciones y pactos internacionales, el respeto de los derechos humanos los compromisos en la legislación nacional, la presentación de informes y seguimiento, así como el diálogo sobre derechos humanos. Defensores de derechos humanos y ONG de derechos humanos, la promoción de los derechos humanos, el activismo, la movilización, la sensibilización pública y educación en derechos humanos. Los derechos humanos de programación dirigida a grupos específicos, por ejemplo, los niños, las personas con discapacidad, inmigrantes, minorías étnicas, religiosas, lingüísticas y sexuales, los indígenas y los que sufren de la discriminación de castas, las víctimas de la trata, las víctimas de la tortura. (Use  el código 15230, cuando se trate de procesos de consolidación de la paz tras los conflictos (Naciones Unidas)', 'Measures to support specialised official human rights institutions and mechanisms at universal, regional, national and local levels in their statutory roles to promote and protect civil and political, economic, social and cultural rights as defined in international conventions and covenants; translation of international human rights commitments into national legislation; reporting and follow-up; human rights dialogue.\n\nHuman rights defenders and human rights NGOs; human rights advocacy, activism, mobilisation; awareness raising and public human rights education.\n\nHuman rights programming targeting specific groups, e.g. children, persons with disabilities, migrants, ethnic, religious, linguistic and sexual minorities, indigenous people and those suffering from caste discrimination, victims of trafficking, victims of torture. \n\n(Use code 15230 when in connection with UN post conflict peace-building.)\n'),
(15170, 'Organizaciones e instituciones de la igualdad de las mujeres', 'Women’s equality organisations and institutions', 151, 'Ayuda para las instituciones y las organizaciones (gubernamentales y no gubernamentales) que trabajan para la igualdad del género y el empoderamiento de las mujeres.', 'Support for institutions and organisations (governmental and non-governmental) working for gender equality and women’s empowerment.'),
(15210, 'Gestión y reforma de los sistemas de seguridad', 'Security system management and reform', 152, 'Cooperación técnica en favor de los parlamentos, Ministerios públicos, servicios encargados de hacer respetar la ley y de las instancias judiciales para ayudar a examinar y a reformar los sistemas de seguridad con el fin de mejorar el control democrático del gobierno y de la sociedad civil. Cooperación técnica en favor de los Gobiernos en apoyo del refuerzo de la supervisión civil y el control democrático sobre la consignación presupuestaria, la gestión, la transparencia y la auditoría de los gastos de seguridad, incluidos los gastos militares, en el marco de un programa de mejora de la gestión de los gastos públicos;  Asistencia  a la sociedad civil con el fin de reforzar sus competencias en cuanto a seguridad y su capacidad de velar para que el sistema de seguridad esté administrado de acuerdo con las normas democráticas y por los principios de responsabilidad, transparencia y buena gobernanza.', 'Technical co-operation provided to parliament, government ministries, law enforcement agencies and the judiciary to assist review and reform of the security system to improve democratic governance and civilian control; technical co-operation provided to government to improve civilian oversight and democratic control of budgeting, management, accountability and auditing of security expenditure, including military budgets, as part of a public expenditure management programme; assistance to civil society to enhance its competence and capacity to scrutinise the security system so that it is managed in accordance with democratic norms and principles of accountability, transparency and good governance.'),
(15220, 'Construcción de la paz y prevención y solución de conflictos', 'Civilian peace-building, conflict prevention and resolution', 152, 'Ayuda para las actividades civiles se relacionada con la construcción de la paz, la prevención y solución de conflictos, incluyendo el refuerzo de las capacidades, la supervisión, el diálogo y el intercambio de información.', 'Support for civilian activities related to peace building, conflict prevention and resolution, including capacity building, monitoring, dialogue and information exchange.'),
(15230, 'Procesos de consolidación de la paz tras los conflictos (Naciones Unidas)', 'Post-conflict peace-building (UN)', 152, 'En el marco de las operaciones de paz de Naciones Unidas, participación en la fase de consolidación de la paz tras los conflictos (actividades tales como supervisión de la aplicación de medidas de protección de derechos humanos y observación de elecciones, ayuda para la reinserción de soldados desmovilizados, recuperación de infraestructura nacional básica, supervisión o reciclaje de administradores civiles y de fuerzas de policía, formación en procedimientos aduaneros y de control de fronteras, asesoramiento o formación en políticas fiscales o de estabilización macroeconómica, repatriación y desmovilización de grupos armados y destrucción de sus armas; apoyo eliminación minas antipersonas).  Los impuestos directos al presupuesto de la ONU de mantenimiento de la paz no deben notificarse como AOD hasta que la ONU sea capaz de identificar el componente AOD.', 'Participation in the post-conflict peace-building phase of United Nations peace operations (activities such as human rights and elections monitoring, rehabilitation of demobilised soldiers, rehabilitation of basic national infrastructure,  monitoring or retraining of civil administrators and police forces, training in customs and border control procedures, advice or training in fiscal or macroeconomic stabilisation policy, repatriation and demobilisation of armed factions, and disposal of their weapons; support for landmine removal).  Direct contributions to the UN peacekeeping budget are excluded from bilateral ODA (they are reportable in part as multilateral ODA).'),
(15240, 'Control de la proliferación de armas ligeras y de pequeño calibre.', 'Reintegration and SALW control', 152, 'Reinserción del personal militar desmovilizado en la vida económica y civil; conversión de las fábricas de armas en fábricas de productos de uso civil; cooperación técnica destinada para controlar,  prevenir y/o  reducir la proliferación de armas ligeras y pequeño calibre - ver el Apéndice para la definición de las actividades cubiertas. [ Otro que el en relación con el mantenimiento de la paz la ONU (15230) o niños soldados (15261) ].', 'Reintegration of demobilised military personnel into the economy; conversion of production facilities from military to civilian outputs; technical co-operation to control, prevent and/or reduce the proliferation of small arms and light weapons (SALW) – see para. 39 of the DAC Statistical Reporting Directives for definition of SALW activities covered. [Other than in connection with UN peace-building (15230) or child soldiers (15261)].'),
(15250, 'Retirada minas antipersonas', 'Land mine clearance', 152, 'Eliminación minas explosivas con fines de desarrollo [que no corresponda a consolidación de la paz (15230)].', 'Explosive mine removal for developmental purposes [other than in connection with UN peace-building (15230)].'),
(15261, 'Niños soldados, prevención y desmovilización', 'Child soldiers (Prevention and demobilisation) ', 152, 'Cooperación técnica en favor de los Gobiernos - y asistencia a las organizaciones de la sociedad civil - en apoyo de la adopción y la aplicación de leyes destinadas a impedir la contratación de niños como soldados; apoyo a la desmovilización, al desarme, a la reinserción, a la repatriación y a la reintegración (DDR) de los niños soldados.', 'Technical co-operation provided to government – and assistance to civil society organisations – to support and apply legislation designed to prevent the recruitment of child soldiers, and to demobilise, disarm, reintegrate, repatriate and resettle (DDR) child soldiers.'),
(16010, 'Servicios sociales', 'Social/ welfare services', 160, 'Legislación y administración sociales; fortalecimiento de instituciones y asesoramiento; seguridad social y otros planes sociales; programas especiales para tercera edad, huérfanos, discapacitados, niños abandonados; dimensiones sociales de ajustes estructurales; infraestructura y servicios sociales sin especificar, incluida la protección de los consumidores.', 'Social legislation and administration; institution capacity building and advice; social security and other social schemes; special programmes for the elderly, orphans, the disabled, street children; social dimensions of structural adjustment; unspecified social infrastructure and services, including consumer protection.'),
(16020, 'Política de empleo y gestión administrativa', 'Employment policy and administrative management', 160, 'Política y planificación del empleo; legislación laboral; sindicatos; fortalecimiento institucional y asesoramiento a instituciones; programas de ayuda para desempleados; programas de creación de empleo y generación de ingresos; seguridad e higiene en el trabajo; lucha contra el trabajo infantil.', 'Employment policy and planning; labour law; labour unions; institution capacity building and advice; support programmes for unemployed; employment creation and income generation programmes; occupational safety and health; combating child labour.'),
(16030, 'Política de vivienda y gestión administrativa', 'Housing policy and administrative management', 160, 'Política de la vivienda, planificación y programas; no incluye viviendas a bajo coste y erradicación del chabolismo (16040).', 'Housing sector policy, planning and programmes;  excluding low-cost housing and slum clearance (16040).'),
(16040, 'Viviendas de bajo coste', 'Low-cost housing', 160, 'Incluye erradicación de chabolismo.', 'Including slum clearance.'),
(16050, 'Ayuda multisectorial para servicios sociales básicos', 'Multisector aid for basic social services ', 160, 'Los servicios sociales básicos quedan definidos de manera que incluyan  la educación básica, la sanidad básica, la nutrición básica, la salud reproductiva y las cuestiones de población,  el suministro básico de agua potable y el saneamiento básico. ', 'Basic social services are defined to include basic education, basic health, basic nutrition, population/reproductive health and basic drinking water supply and basic sanitation.'),
(16061, 'Cultura y ocio', 'Culture and recreation', 160, 'Incluye bibliotecas y museos.', 'Including libraries and museums.'),
(16062, 'Capacitación estadística', 'Statistical capacity building', 160, 'Tanto en institutos nacionales de estadística como en cualquier departamento ministerial.', 'Both in national statistical offices and any other government ministries.'),
(16063, 'Control estupefacientes', 'Narcotics control', 160, 'Controles aduaneros y nacionales, incluida la formación de la policía; programas educativos y campañas de sensibilización para reducir el tráfico de drogas y la distribución interna.', 'In-country and customs controls including training of the police; educational programmes and awareness campaigns to restrict narcotics traffic and in-country distribution.'),
(16064, 'Mitigación social de HIV/AIDS', 'Social mitigation of HIV/AIDS', 160, 'Programas especiales que se destinan a tratar las consecuencias sociales del VIH/SIDA, por ejemplo asistencia social, jurídica y económica a las personas viviendo con el VIH/SIDA incluidas seguridad alimentaria y empleo; apoyo a los grupos vulnerables y a los niños huérfanos del SIDA; derechos humanos para las personas afectadas por el VIH/SIDA.', 'Special programmes to address the consequences of HIV/AIDS, e.g. social, legal and economic assistance to people living with HIV/AIDS including food security and employment; support to vulnerable groups and children orphaned by HIV/AIDS; human rights of HIV/AIDS affected people. '),
(21010, 'Política transporte y gestión administrativa', 'Transport policy and administrative management', 210, 'Política de transportes, planificación y ayuda a programas; ayuda a ministerios transporte; fortalecimiento instituciones, asesoramiento; transporte no especificado; actividades que combinan el transporte por carretera, ferrocarril, fluvial y/o transporte aéreo.', 'Transport sector policy, planning and programmes; aid to transport ministries; institution capacity building and advice; unspecified transport; activities that combine road, rail, water and/or air transport.'),
(21020, 'Transporte por carretera', 'Road transport', 210, 'Infraestructura de carreteras, vehículos; transporte de pasajeros por carretera, vehículos particulares.', 'Road infrastructure, road vehicles; passenger road transport, motor passenger cars.'),
(21030, 'Transporte por ferrocarril', 'Rail transport', 210, 'Infraestructura ferroviaria, equipamiento ferroviario, locomotoras, otro material rodante; se incluyen tranvías y suburbano.', 'Rail infrastructure, rail equipment, locomotives, other rolling stock; including light rail (tram) and underground systems.'),
(21040, 'Transporte marítimo y fluvial', 'Water transport', 210, 'Puertos, desembarcaderos, muelles; sistemas de guía portuaria, buques, barcas, lanchas; transporte fluvial, navegación interior.', 'Harbours and docks, harbour guidance systems, ships and boats; river and other inland water transport, inland barges and vessels.'),
(21050, 'Transporte aéreo', 'Air transport', 210, 'Aeropuertos, sistemas guía aeropuerto; aviones, equipo mantenimiento de aviones', 'Airports, airport guidance systems, aeroplanes, aeroplane maintenance equipment.'),
(21061, 'Almacenamiento', 'Storage', 210, 'Relacionado o no con el transporte.', 'Whether or not related to transportation.'),
(21081, 'Enseñanza y formación en materia de transporte y almacenamiento', 'Education and training in transport and storage', 210, NULL, NULL),
(22010, 'Política de comunicaciones y gestión administrativa', 'Communications policy and administrative management', 220, 'Política de comunicaciones, planificación y ayuda a programas; fortalecimiento de instituciones, asesoramiento; incluye el desarrollo de servicios postales; actividades de comunicaciones no especificadas.', 'Communications sector policy, planning and programmes; institution capacity building and advice; including postal services development; unspecified communications activities.'),
(22020, 'Telecomunicaciones', 'Telecommunications', 220, 'Redes telefónicas, satélites de telecomunicaciones, estaciones terrestres.', 'Telephone networks, telecommunication satellites, earth stations.'),
(22030, 'Radio, televisión, prensa', 'Radio/television/print media', 220, 'Enlaces de radio y televisión, equipamiento; periódicos; imprenta y edición.', 'Radio and TV links, equipment; newspapers; printing and publishing.'),
(22040, 'Tecnología de la información y de las comunicaciones (TIC)', 'Information and communication technology (ICT)', 220, 'Equipos y programas informáticos; acceso a Internet; formación en tecnologías de la información. Sectores no especificados.', 'Computer hardware and software; internet access; IT training.  When sector cannot be specified.  '),
(23010, 'Política energética y gestión administrativa', 'Energy policy and administrative management', 230, 'Política energética, planificación y ayuda a programas; ayuda a ministerios de energía; fortalecimiento institucional, asesoramiento; actividades del sector energético no especificadas.', 'Energy sector policy, planning and programmes; aid to energy ministries; institution capacity building and advice; unspecified energy activities including energy conservation.'),
(23020, 'Producción energética-fuentes no renovables', 'Power generation/non-renewable sources ', 230, 'Centrales térmicas (incluye fuentes de calor que no pueden determinarse); centrales alimentadas con gas y carbón.', 'Thermal power plants including when heat source cannot be determined; combined gas-coal power plants.'),
(23030, 'Producción energética-fuentes renovables', 'Power generation/renewable sources ', 230, 'Comprende política, planificación, desarrollo de programas, estudios e incentivos. La producción de leña y de carbón vegetal debe incluirse en Silvicultura (31261)', 'Including policy, planning, development programmes, surveys and incentives. Fuelwood/ charcoal production should be included under forestry (31261).'),
(23040, 'Transmisión/distribución energía eléctrica', 'Electrical transmission/ distribution', 230, 'Distribución desde la fuente de energía al consumidor; líneas de transmisión.', 'Distribution from power source to end user; transmission lines.'),
(23050, 'Distribución gas', 'Gas distribution', 230, 'Distribución al consumidor.', 'Delivery for use by ultimate consumer.'),
(23061, 'Central térmica de petróleo', 'Oil-fired power plants', 230, 'Comprende las centrales alimentadas con gasoil.', 'Including diesel power plants.'),
(23062, 'Central térmica de gas', 'Gas-fired power plants', 230, NULL, NULL),
(23063, 'Central térmica de carbón', 'Coal-fired power plants', 230, NULL, NULL),
(23064, 'Centrales nucleares', 'Nuclear power plants', 230, 'Incluye la seguridad nuclear.', 'Including nuclear safety.'),
(23065, 'Centrales nucleares', 'Hydro-electric power plants', 230, 'Incluye la seguridad nuclear.', 'Including power-generating river barges.'),
(23066, 'Energía geotérmica', 'Geothermal energy', 230, NULL, NULL),
(23067, 'Energía solar', 'Solar energy', 230, 'Incluye células fotovoltaicas, aplicaciones de energía solar.', 'Including photo-voltaic cells, solar thermal applications and solar heating.'),
(23068, 'Energía eólica', 'Wind power', 230, 'Energía Eólica para hidrodinámica y para la producción de electricidad.', 'Wind energy for water lifting and electric power generation.'),
(23069, 'Aprovechamiento energía marítima', 'Ocean power', 230, 'Incluye la conversión de energía térmica marina, la fuerza de las mareas y de las olas.', 'Including ocean thermal energy conversion, tidal and wave power.'),
(23070, 'Biomasa', 'Biomass', 230, 'Tecnologías de densificación y uso de la biomasa para la producción de energía directa, incluyendo el gas obtenido por la fermentación de la caña de azúcar', 'Densification technologies and use of biomass for direct power generation including biogas, gas obtained from sugar cane and other plant residues, anaerobic digesters.'),
(23081, 'Educación, formación temas energéticos', 'Energy education/training', 230, 'Se refiere a todos los subsectores de la energía, y a todos los niveles de formación.', 'Applies to all energy sub-sectors; all levels of training.'),
(23082, 'Investigación energética', 'Energy research', 230, 'Incluye inventarios y estudios.', 'Including general inventories, surveys.'),
(24010, 'Política financiera y gestión administrativa', 'Financial policy and administrative management', 240, 'Política de finanzas, planificación y ayudas a programas; fortalecimiento de instituciones, asesoramiento; mercados y sistemas financieros', 'Finance sector policy, planning and programmes; institution capacity building and advice; financial markets and systems.'),
(24020, 'Instituciones monetarias', 'Monetary institutions', 240, 'Bancos centrales.', 'Central banks.'),
(24030, 'Instituciones financieras', 'Formal sector financial intermediaries', 240, 'Todas las instituciones financieras del sector formal incluyendo bancos de desarrollo (excepto cuando el banco de desarrollo se dedica a un solo sector); seguros, \"leasing\", capital-riesgo.', 'All formal sector financial intermediaries; credit lines; insurance, leasing, venture capital, etc. (except when focused on only one sector).'),
(24040, 'Otros servicios financieros', 'Informal/semi-formal financial intermediaries', 240, 'Incluye las instituciones financieras en el sector informal (por ejemplo: micro créditos, cooperativas de ahorro y de crédito, etc.)', 'Micro credit, savings and credit co-operatives etc.'),
(24081, 'Enseñanza / formación en banca y servicios financieros', 'Education/training in banking and financial services', 240, NULL, NULL),
(25010, 'Servicios comerciales', 'Business support services and institutions', 250, 'Desarrollo de empresas; apoyo a las asociaciones de comercio y de empresas, cámaras de comercio, empresas privadas; servicios de asesoramiento a empresas, contabilidad, auditorías; reformas jurídicas y reglamentarias para mejorar el entorno comercial de las empresas, reforzamiento de instituciones, asesoramiento, etc.', 'Support to trade and business associations, chambers of commerce; legal and regulatory reform aimed at improving business and investment climate; private sector institution capacity building and advice; trade information; public-private sector networking including trade fairs; e‑commerce.  Where sector cannot be specified: general support to private sector enterprises (in particular, use code 32130 for enterprises in the industrial sector).'),
(25020, 'Privatizaciones', 'Privatisation', 250, 'Cuando el sector no puede ser especificado. Incluye programas de reestructuración de empresas públicas o programas para eliminar los monopolios; planificación, programación, asesoramiento.', 'When sector cannot be specified.  Including general state enterprise restructuring or demonopolisation programmes; planning, programming, advice.'),
(31110, 'Política agrícola y gestión administrativa', 'Agricultural policy and administrative management', 311, 'Política agrícola, planificación y ayuda a programas; ayuda a los ministerios agrícolas; fortalecimiento de instituciones; actividades agrícolas no especificadas.', 'Agricultural sector policy, planning and programmes; aid to agricultural ministries;  institution capacity building and advice; unspecified agriculture.'),
(31120, 'Desarrollo agrario', 'Agricultural development', 311, 'Proyectos integrados; desarrollo de explotaciones agrícolas.', 'Integrated projects; farm development.'),
(31130, 'Tratamiento del suelo agrícola', 'Agricultural land resources', 311, 'Incluye lucha contra la degradación del suelo; mejora de suelos; drenaje de zonas inundadas; desalinización de suelos; estudio de terrenos agrícolas; lucha contra la erosión; lucha contra la desertificación.', 'Including soil degradation control; soil improvement; drainage of water logged areas; soil desalination; agricultural land surveys; land reclamation; erosion control, desertification control.'),
(31140, 'Recursos hidrológicos para uso agrícola', 'Agricultural water resources', 311, 'Regadíos, embalses, estructuras hidráulicas, explotación de capas freáticas.', 'Irrigation, reservoirs, hydraulic structures, ground water exploitation for agricultural use.'),
(31150, 'Factores producción (inputs) agrícolas', 'Agricultural inputs', 311, 'Suministro de semillas, fertilizantes, equipos/maquinaria agrícola.', 'Supply of seeds, fertilizers, agricultural machinery/equipment.'),
(31161, 'Producción agrícola', 'Food crop production', 311, 'Incluye cereales (trigo, arroz, cebada, maíz, centeno, avena, mijo, sorgo); horticultura; verduras; frutas, bayas; otros productos cultivables.', 'Including grains (wheat, rice, barley, maize, rye, oats, millet, sorghum); horticulture; vegetables; fruit and berries; other annual and perennial crops. [Use code 32161 for agro-industries.]'),
(31162, 'Cosechas destinadas a la exportación o a la industria', 'Industrial crops/export crops', 311, 'Incluye azúcar, café, caco, té, oleaginosas, nueces, almendras, fibras, tabaco, caucho.', 'Including sugar; coffee, cocoa, tea; oil seeds, nuts, kernels; fibre crops; tobacco; rubber.  [Use code 32161 for agro-industries.]'),
(31163, 'Ganadería', 'Livestock', 311, 'Cría, producción ganadera; aves de corral; alimentos para animales.', 'Animal husbandry; animal feed aid.'),
(31164, 'Reforma agraria', 'Agrarian reform', 311, 'Incluye ajuste estructural en el sector agrícola.', 'Including agricultural sector adjustment.'),
(31181, 'Capacitación agraria', 'Agricultural alternative development', 311, NULL, 'Projects to reduce illicit drug cultivation through other agricultural marketing and production opportunities (see code 43050 for non-agricultural alternative development).'),
(31182, 'Extensión agraria', 'Agricultural extension', 311, 'Formación agrícola informal.', 'Non-formal training in agriculture.'),
(31183, 'Investigación agrícola', 'Agricultural education/training', 311, 'Incluye el estudio de especies vegetales, fisiología, recursos genéticos, ecología, taxonomía, lucha contra las enfermedades, biotecnología agrícola.', NULL),
(31184, 'Investigación ganadera', 'Agricultural research', 311, 'Incluye investigación genética y sanitaria, nutrición, fisiología.', 'Plant breeding, physiology, genetic resources, ecology, taxonomy, disease control, agricultural bio-technology; including livestock research (animal health, breeding and genetics, nutrition, physiology).'),
(31191, 'Servicios agrícolas', 'Agricultural services', 311, 'Organización y políticas de mercado; seguro cosechas; transporte y almacenamiento; establecimiento de reservas estratégicas.', 'Marketing policies & organisation; storage and transportation, creation of strategic reserves.'),
(31192, 'Protección plantas y lucha contra plagas', 'Plant and post-harvest protection and pest control', 311, 'Incluye el suministro de pesticidas.', 'Including integrated plant protection, biological plant protection activities, supply and management of agrochemicals, supply of pesticides, plant protection policy and legislation.'),
(31193, 'Crédito agrícola', 'Agricultural financial services', 311, 'Bancos de desarrollo agrícola; planes de crédito.', 'Financial intermediaries for the agricultural sector including credit schemes; crop insurance.'),
(31194, 'Cooperativas agrícolas', 'Agricultural co-operatives', 311, 'Incluye las organizaciones de agricultores.', 'Including farmers’ organisations.'),
(31195, 'Servicios veterinarios', 'Livestock/veterinary services', 311, 'Sanidad animal, recursos genéticos y nutritivos.', 'Animal health and management, genetic resources, feed resources.');
INSERT INTO `crss` (`cod_crs`, `nom_crs`, `nom_crsIngles`, `cod_cadsub`, `informacionesESP`, `informacionesING`) VALUES
(31210, 'Política forestal y gestión administrativa', 'Forestry policy and administrative management', 312, 'Política forestal, planificación y ayuda de programas; fortalecimiento institucional, asesoramiento; estudios forestales; actividades forestales sin especificar.', 'Forestry sector policy, planning and programmes; institution capacity building and advice; forest surveys; unspecified forestry and agro-forestry activities.'),
(31220, 'Desarrollo forestal', 'Forestry development', 312, 'Repoblación forestal, planificación y ayuda de programas; fortalecimiento institucional, asesoramiento; estudios forestales; actividades forestales sin especificar.', 'Afforestation for industrial and rural consumption; exploitation and utilisation; erosion control, desertification control; integrated forestry projects.'),
(31261, 'Producción carbón vegetal, leña.', 'Fuelwood/charcoal', 312, 'Desarrollo forestal dedicado a la producción de leña y carbón vegetal.', 'Forestry development whose primary purpose is production of fuelwood and charcoal.'),
(31281, 'Educación, formación forestal', 'Forestry education/training', 312, NULL, NULL),
(31282, 'Investigación silvicultura', 'Forestry research', 312, 'Incluye reproducción artificial y mejora de especies, métodos de producción, fertilizantes, corta y recogida de madera.', 'Including artificial regeneration, genetic improvement, production methods, fertilizer, harvesting.'),
(31291, 'Servicios forestales', 'Forestry services', 312, NULL, NULL),
(31310, 'Política pesquera y gestión administrativa', 'Fishing policy and administrative management', 313, 'Política pesquera, planificación y ayuda a programas; fortalecimiento institucional, asesoramiento; pesca de altura y de cabotaje; evaluación, estudios y prospección pesquera en medios marino y fluvial; barcos y equipamiento pesqueros; actividades de pesca sin especificar.', 'Fishing sector policy, planning and programmes; institution capacity building and advice; ocean and coastal fishing; marine and freshwater fish surveys and prospecting; fishing boats/equipment; unspecified fishing activities.'),
(31320, 'Desarrollo pesquero', 'Fishery development', 313, 'Explotación y utilización de pesquerías; protección de bancos pesqueros; acuicultura; proyectos integrados.', 'Exploitation and utilisation of fisheries; fish stock protection; aquaculture; integrated fishery projects.'),
(31381, 'Educación, formación pesquera', 'Fishery education/training', 313, NULL, NULL),
(31382, 'Investigación pesquera', 'Fishery research', 313, 'Piscicultura modelo; investigación biológica acuática.', 'Pilot fish culture; marine/freshwater biological research.'),
(31391, 'Servicios pesqueros', 'Fishery services', 313, 'Puertos pesqueros; mercados pesca; transporte y almacenamiento frigorífico de pescado.', 'Fishing harbours; fish markets; fishery transport and cold storage.'),
(32110, 'Política industrial y gestión administrativa', 'Industrial policy and administrative management', 321, 'Política industrial, planificación y programas; fortalecimiento institucional y asesoramiento; actividades industriales no especificadas; industrias productivas no especificadas más abajo.', 'Industrial sector policy, planning and programmes; institution capacity building and advice; unspecified industrial activities; manufacturing of goods not specified below.'),
(32120, 'Desarrollo industrial', 'Industrial development', 321, NULL, NULL),
(32130, 'Desarrollo PYME', 'Small and medium-sized enterprises (SME) development', 321, 'Apoyo directo al desarrollo de pequeñas y medianas empresas del sector industrial, con inclusión de servicios de contabilidad, auditoría y asesoramiento.', 'Direct support to the development of small and medium-sized enterprises in the industrial sector, including accounting, auditing and advisory services.'),
(32140, 'Industria artesanal ', 'Cottage industries and handicraft', 321, NULL, NULL),
(32161, 'Agroindustrias', 'Agro-industries', 321, 'Industrias alimentarias básicas, productos lácteos, mataderos y equipamiento necesario, industria de procesamiento y conservera de carne y pescado, industrias de aceites/grasas, azucareras, producción de bebidas, tabaco, producción de piensos.', 'Staple food processing, dairy products, slaughter houses and equipment, meat and fish processing and preserving, oils/fats, sugar refineries, beverages/tobacco, animal feeds production.'),
(32162, 'Industrias forestales', 'Forest industries', 321, 'Producción de madera, papel y de pasta de papel.', 'Wood production, pulp/paper production.'),
(32163, 'Textiles, cuero y sustitutos', 'Textiles, leather and substitutes', 321, 'Incluye talleres de géneros de punto.', 'Including knitting factories. '),
(32164, 'Productos químicos', 'Chemicals ', 321, 'Instalaciones de producción industrial y no industrial; incluye producción de plaguicidas.', 'Industrial and non-industrial production facilities; includes pesticides production.'),
(32165, 'Plantas de producción de fertilizantes', 'Fertilizer plants', 321, NULL, NULL),
(32166, 'Cemento, cal, yeso', 'Cement/lime/plaster', 321, NULL, NULL),
(32167, 'Fabricación productos energéticos', 'Energy manufacturing', 321, 'Incluye licuefacción de gas; refinerías de petróleo.', 'Including gas liquefaction; petroleum refineries.'),
(32168, 'Producción farmacéutica', 'Pharmaceutical production', 321, 'Equipamiento / suministros médicos; fármacos, medicamentos, vacunas; productos higiénicos.', 'Medical equipment/supplies; drugs, medicines, vaccines; hygienic products.'),
(32169, 'Industria metalúrgica básica', 'Basic metal industries', 321, 'Siderurgia, producción de metales estructurales.', 'Iron and steel, structural metal production.'),
(32170, 'Industrias metales no ferrosos', 'Non-ferrous metal industries', 321, NULL, NULL),
(32171, 'Construcción mecánica y eléctrica', 'Engineering', 321, 'Fabricación de maquinaria eléctrica y no eléctrica, motores y turbinas.', 'Manufacturing of electrical and non-electrical machinery, engines/turbines.'),
(32172, 'Material de transporte', 'Transport equipment industry', 321, 'Construcción de buques, de barcos de pesca; material ferroviario; autobuses y vehículos particulares; construcción aeronáutica; sistemas de navegación y de teledirección.', 'Shipbuilding, fishing boats building; railroad equipment; motor vehicles and motor passenger cars; aircraft; navigation/guidance systems.'),
(32182, 'Investigación y desarrollo tecnológico ', 'Technological research and development', 321, 'Incluye normalización industrial; control de calidad; metrología, ensayos, acreditación, certificación.', 'Including industrial standards; quality management; metrology;  testing;  accreditation;  certification.'),
(32210, 'Política de las industrias extractivas y gestión administrativa', 'Mineral/mining policy and administrative management', 322, 'Política de las industrias extractivas, planificación y programas, legislación minera, catastro minero, inventario recursos minerales, sistemas de información, fortalecimiento institucional y asesoramiento; explotación de recursos minerales no especificados.', 'Mineral and mining sector policy, planning and programmes;  mining legislation, mining cadastre, mineral resources inventory, information systems, institution capacity building and advice;  unspecified mineral resources exploitation.'),
(32220, 'Prospección de minerales y exploración', 'Mineral prospection and exploration', 322, 'Geología, geofísica, geoquímica; se excluye la hidrogeología (14010) y la geología medioambiental (41010), extracción y procesamiento de minerales, infraestructura, tecnología, economía, seguridad y gestión del medio ambiente.', 'Geology, geophysics, geochemistry;  excluding hydrogeology (14010) and environmental geology (41010), mineral extraction and processing, infrastructure, technology, economics, safety and environment management.'),
(32261, 'Carbón', 'Coal', 322, 'Incluye lignito y turba.', 'Including lignite and peat.'),
(32262, 'Petróleo y gas', 'Oil and gas', 322, 'Petróleo, gas natural, condensados, gases licuados del petróleo (LPG), gas natural líquido (LNG), incluidas perforaciones y producción.', 'Petroleum, natural gas, condensates, liquefied petroleum gas (LPG), liquefied natural gas (LNG);  including drilling and production.'),
(32263, 'Metales ferrosos', 'Ferrous metals', 322, 'Hierro y metales de aleación ferrosa.', 'Iron and ferro-alloy metals.'),
(32264, 'Metales no ferrosos', 'Nonferrous metals', 322, 'Aluminio, cobre, plomo, níquel, estaño, zinc.', 'Aluminium, copper, lead, nickel, tin, zinc.'),
(32265, 'Metales / minerales preciosos', 'Precious metals/materials', 322, 'Oro, plata, platino, diamantes, piedras preciosas.', 'Gold, silver, platinum, diamonds, gemstones.'),
(32266, 'Minerales industriales', 'Industrial minerals', 322, 'Barita, caliza, feldespato, caolín, arena, grava, yeso, piedras ornamentales.', 'Baryte, limestone, feldspar, kaolin, sand, gypsym, gravel, ornamental stones.'),
(32267, 'Fertilizantes minerales', 'Fertilizer minerals', 322, 'Fosfatos, potasas.', 'Phosphates, potash.'),
(32268, 'Recursos minerales fondos marinos', 'Offshore minerals', 322, 'Nódulos polimetálicos, fosforitas, depósitos aluviales de minerales.', 'Polymetallic nodules, phosphorites, marine placer deposits.'),
(32310, 'Política de construcción y gestión administrativa', 'Construction policy and administrative management', 323, 'Política del sector de la construcción, planificación; se excluyen las actividades de construcción en sectores específicos (por ejemplo, construcción de hospitales o escuelas).', 'Construction sector policy and planning; excluding construction activities within specific sectors (e.g., hospital or school construction).'),
(41010, 'Política medioambiental y gestión administrativa', 'Environmental policy and administrative management', 410, 'Política medioambiental, leyes, reglamentos e instrumentos económicos; instituciones y prácticas administrativas; planificación del medio ambiente y del uso del suelo; procedimientos de toma de decisiones; seminarios, reuniones; medidas diversas de conservación y protección no especificadas más adelante.', 'Environmental policy, laws, regulations and economic instruments; administrational institutions and practices; environmental and land use planning and decision-making procedures; seminars, meetings; miscellaneous conservation and protection measures not specified below.'),
(41020, 'Protección de la biosfera', 'Biosphere protection', 410, 'Lucha contra la contaminación del aire, protección de la capa de ozono; lucha contra la contaminación marina.', 'Air pollution control, ozone layer preservation; marine pollution control.'),
(41030, 'Biodiversidad', 'Bio-diversity', 410, 'Incluye reservas naturales y acciones en las áreas circundantes; otras medidas para proteger especies vulnerables o en peligro de extinción y sus hábitats (por ejemplo, protección de humedales).', 'Including natural reserves and actions in the surrounding areas; other measures to protect endangered or vulnerable species and their habitats (e.g. wetlands preservation).'),
(41040, 'Protección del patrimonio ', 'Site preservation', 410, 'Se refiere a paisajes culturales excepcionales; incluye lugares, objetos de valor histórico, arqueológico, estético, científico o educativo.', 'Applies to unique cultural landscape; including sites/objects of historical, archeological, aesthetic, scientific or educational value.'),
(41050, 'Control / prevención de inundaciones', 'Flood prevention/control', 410, 'Inundaciones provocadas por ríos o mares; se incluyen actividades relacionadas con el control de intrusión de agua de mar y de subidas del nivel del mar.', 'Floods from rivers or the sea; including sea water intrusion control and sea level rise related activities.'),
(41081, 'Educación / formación medioambiental', 'Environmental education/ training', 410, NULL, NULL),
(41082, 'Investigación medioambiental', 'Environmental research', 410, 'Comprende el establecimiento de bases de datos, inventarios y estimaciones de recursos naturales y físicos; perfiles medioambientales y estudios de impacto cuando el sector no puede ser determinado.', 'Including establishment of databases, inventories/accounts of physical and natural resources; environmental profiles and impact studies if not sector specific.'),
(43010, 'Ayuda multisectorial', 'Multisector aid', 430, NULL, NULL),
(43030, 'Desarrollo y gestión urbanos', 'Urban development and management', 430, 'Proyectos integrados de desarrollo urbano; desarrollo local y gestión urbana; infraestructura y servicios urbanos; finanzas municipales; gestión medio ambiente urbano; desarrollo y planificación urbanos; renovación y vivienda urbanos; sistemas catastrales.', 'Integrated urban development projects; local development and urban management; urban infrastructure and services; municipal finances; urban environmental management; urban development and planning; urban renewal and urban housing; land information systems.'),
(43040, 'Desarrollo rural', 'Rural development', 430, 'Proyectos integrados de desarrollo rural; por ejemplo planificación del desarrollo regional; fomento de capacidad descentralizada y multisectorial de planificación, coordinación y gestión; puesta en práctica del desarrollo regional y de medidas regionales (con inclusión de gestión de reservas naturales); gestión del suelo; planificación de la utilización del suelo; integración funcional de áreas rurales y urbanas; sistemas de información geográfica.', 'Integrated rural development projects;  e.g. regional development planning;  promotion of decentralised and multi-sectoral competence for planning, co-ordination and management;  implementation of regional development and measures (including natural reserve management);  land management;  land use planning; land settlement and resettlement activities [excluding resettlement of refugees and internally displaced persons (72010)]; functional integration of rural and urban areas;  geographical information systems.'),
(43050, 'Desarrollo alternativo no agrario', 'Non-agricultural alternative development', 430, 'Proyectos para reducir las áreas  de cultivo ilegal de drogas, a través, por ejemplo, de posibilidades de ingresos no agrícolas, infraestructura material y social (véase el código 31165 para desarrollo alternativo agrario) ', 'Projects to reduce illicit drug cultivation through, for example, non-agricultural income opportunities, social and physical infrastructure (see code 31165 for agricultural alternative development).'),
(43081, 'Enseñanza / formación multisectorial', 'Multisector education/training', 430, 'Comprende becas.', 'Including scholarships.'),
(43082, 'Instituciones científicas y de investigación      ', 'Research/scientific institutions', 430, 'Cuando el sector no pueda determinarse.', 'When sector cannot be identified.'),
(51010, 'Apoyo presupuestario general ', 'General budget support', 510, 'Contribuciones a los presupuestos no asignadas a partidas específicas; apoyo a la aplicación de reformas macroeconómicas (programas de ajuste estructural, estrategias de reducción de la pobreza); transferencias para la estabilización de la balanza de pagos (p.ej. STABEX, sistemas de garantía de los tipos de cambio); ayuda general para programas (cuando no esté asignada por sectores).', 'Unearmarked contributions to the government budget; support for the implementation of macroeconomic reforms (structural adjustment programmes, poverty reduction strategies); general programme assistance (when not allocable by sector).'),
(52010, 'Ayuda alimentaria / Programas de seguridad alimentaria', 'Food aid/Food security programmes', 520, 'Suministro de productos para la alimentación humana al amparo de programas nacionales o internacionales, con inclusión de los costes de transporte; pagos en metálico para la adquisición de alimentos; ayuda alimentaria para proyectos; ayuda alimentaria para venta al público cuando no se haya especificado el sector beneficiario. Se excluye la ayuda alimentaria de emergencia.', 'Supply of edible human food under national or international programmes including transport costs; cash payments made for food supplies; project food aid and food aid for market sales when benefiting sector not specified; excluding emergency food aid.'),
(53030, 'Apoyo importación (bienes de equipo)', 'Import support (capital goods)', 530, 'Bienes de equipo y servicios; líneas de crédito.', 'Capital goods and services; lines of credit.'),
(53040, 'Apoyo importación (productos)', 'Import support (commodities)', 530, 'Productos, bienes y servicios generales, importaciones de petróleo.', 'Commodities, general goods and services, oil imports.'),
(60010, 'Actividades relacionadas con la deuda', 'Action relating to debt', 600, 'Actividades no comprendidas en los códigos expresados a continuación; formación en gestión de la deuda.', 'Actions falling outside the code headings below; training in debt management.'),
(60020, 'Condonación de la deuda', 'Debt forgiveness ', 600, NULL, NULL),
(60030, 'Alivio de la deuda multilateral', 'Relief of multilateral debt', 600, 'Donaciones o préstamos para hacer frente a la deuda contraída con las instituciones financieras multilaterales; se incluyen las contribuciones al fondo fiduciario de la iniciativa HIPC (países pobres altamente endeudados). ', 'Grants or credits to cover debt owed to multilateral financial institutions; including contributions to Heavily Indebted Poor Countries (HIPC) Trust Fund.'),
(60040, 'Reestructuración y refinanciación ', 'Rescheduling and refinancing', 600, NULL, NULL),
(60061, 'Canje de deuda por desarrollo', 'Debt for development swap', 600, 'Asignación de deudas a fines de desarrollo (por ejemplo, deuda por educación, deuda por medio ambiente)', 'Allocation of debt claims to use for development (e.g., debt for education, debt for environment).'),
(60062, 'Otros tipos de canje de deuda', 'Other debt swap', 600, 'Cuando el canje de deuda beneficie a un agente externo, es decir, no se destine específicamente a fines de desarrollo ', 'Where the debt swap benefits an external agent i.e. is not specifically for development purposes.'),
(60063, 'Recompra deuda', 'Debt buy-back', 600, 'Recompra deuda para cancelación. ', 'Purchase of debt for the purpose of cancellation.'),
(72010, 'Ayuda y servicios materiales de emergencia', 'Material relief assistance and services ', 720, 'Vivienda, agua, saneamiento y servicios médicos, medicinas y otros artículos no alimenticios de emergencia; ayuda a los refugiados y a la gente internamente desplazada en países en vías de desarrollo con excepción de ayuda alimentaria de emergencia (72040) o de protección (72050).', 'Shelter, water, sanitation and health services, supply of medicines and other non-food relief items; assistance to refugees and  internally displaced people in developing countries other than for food (72040) or protection (72050).  '),
(72040, 'Ayuda alimentaria de emergencia', 'Emergency food aid', 720, 'Ayuda alimentaria normalmente de distribución general gratuita o programas especiales de alimentación complementaria; ayuda a corto plazo para grupos predefinidos de población afectados por situaciones de emergencia. Excluye los programas de ayuda para la seguridad alimentaria y la ayuda alimentaria (52010).', 'Food aid normally for general free distribution or special supplementary feeding programmes; short-term relief to targeted population groups affected by emergency situations.  Excludes non-emergency food security assistance programmes/food aid (52010).'),
(72050, 'Coordinación de los servicios de protección de la ayuda', 'Relief co-ordination; protection and support services ', 720, 'Medidas de coordinar la entrega de la ayuda humanitaria, incluyendo logística y sistemas de comunicaciones; medidas para promover y  proteger la seguridad, el bienestar, la dignidad y la integridad de las personas en la participación de no hostilidades. (las actividades promovidas para proteger la seguridad de las personas por el uso o la demostración de la fuerza no son computables como AOD.)', 'Measures to co-ordinate delivery of humanitarian aid, including logistics and communications systems;  measures to promote and protect the safety, well-being, dignity and integrity of civilians and those no longer taking part in hostilities.  (Activities designed to protect the security of persons or property through the use or display of force are not reportable as ODA.)                                                                                                                                                '),
(73010, 'Ayuda a la reconstrucción y rehabilitación', 'Reconstruction relief and rehabilitation', 730, 'Trabajo a corto plazo de la reconstrucción tras emergencias o conflictos que se limite a restaurar las infraestructuras preexistente (ej. reparación o construcción de caminos, puentes y puertos, restauración de instalaciones esenciales, tales como agua y saneamiento, viviendas, servicios médicos); rehabilitación social y económica por las consecuencias de emergencias para facilitar a las poblaciones la vuelta a sus condiciones de vida anterior o desarrollar unas nuevas condiciones de vida normales (asesoramiento y tratamiento de traumas,  programas del empleo).', 'Short-term reconstruction work after emergency or conflict limited to restoring pre-existing infrastructure (e.g. repair or construction of roads, bridges and ports, restoration of essential facilities, such as water and sanitation, shelter, health care services); social and economic rehabilitation in the aftermath of emergencies to facilitate transition and enable populations to return to their previous livelihood or develop a new livelihood in the wake of an emergency situation (e.g. trauma counselling and treatment, employment programmes). '),
(74010, 'Prevención de desastres', 'Disaster prevention and preparedness', 740, 'Actividades de la reducción de riesgos de desastres (ej. conocimiento sobre cartografía natural de riesgos nagturales, normas legales para la construcción); sistemas de detección temprana; acciones de  contingencia de emergencia y planificación de emergencia incluyendo preparaciones para desplazamientos forzados.', 'Disaster risk reduction activities (e.g. developing knowledge, natural risks cartography, legal norms for construction); early warning systems; emergency contingency stocks and contingency planning including preparations for forced displacement. '),
(92010, 'Apoyo a ONG nacionales', 'Support to national NGOs', 920, 'En el país donante.', 'In the donor country.'),
(92020, 'Apoyo a ONG internacionales', 'Support to international NGOs', 920, NULL, NULL),
(92030, 'Apoyo a ONG locales y regionales', 'Support to local and regional NGOs', 920, 'En el país o región beneficiarios.', 'In the recipient country or region.'),
(93010, 'Ayuda a refugiados en el país donante', 'Refugees in donor countries', 930, NULL, NULL),
(99810, 'Sectores no especificados', 'Sectors not specified', 998, 'Las contribuciones al desarrollo general del beneficiario deben ser incluidas en la ayuda para programas (51010).', 'Contributions to general development of the recipient should be included under programme assistance (51010).'),
(99820, 'Sensibilización sobre los problemas relacionados con el desarrollo', 'Promotion of development awareness', 998, 'Gastos en el país donante por una mayor sensibilización/interés en la cooperación al desarrollo (folletos, conferencias, proyectos especiales de investigación, etc.).', 'Spending in donor country for heightened awareness/interest in development co-operation (brochures, lectures, special research projects, etc.).');
