(2518, 'MS', 'BO/003/20/AM', 1, 'BO_03_20_AM', NULL, 'AM', 'BO', 'Puerto Carabuco, La Paz', 2020, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'Modal\'idad de Educaci6n Alternat.iva en el Mun.ic.lp.io de Carabuco. Una Educaci6n lternativa para mujeres y varones, para niFios, j6venes y adultos, que requieren oportunidades para desarrollar sus capacidades humanist.ico tecnicas.', 'FMA', '1', 'BOL', '244', NULL, NULL, NULL, NULL, NULL, 188, NULL, NULL, 1, NULL, NULL, 12466.24, 12466.24, 0, 0, NULL, NULL, 0, 12, '2020-01-01 00:00:00', '2020-12-31 00:00:00', '2020-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situations through the sponsorship program.', 15, 316, 5, 'INF', 6, NULL, 1, 1, 1, 'EDU', 'FOR', 110, 77, 26, 51, 'Los niF\\os y j6venes que asisten al Centro, prov.ienen de familias de escasos recursos econ6m.icos, pobres en todo sentido. Son h.ijos de agricultores, pesqueros… familias pobres.', NULL, NULL, 6, 6, NULL, 'El 7/12/20 envió las cartas. Envió el Formulario del Proyecto completo. A finales de año la Responsable Inés Morales la destinan a Brasil y sigue en su lugar Elisabeth Meneses', 0, 3, 3, 0),
(2519, 'MS', 'BO/004/20/AM', 1, 'BO_04_20_AM', NULL, 'AM', 'BO', 'El Alto, La Paz', 2020, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'La Obra Casa María Romero Meneses ofrece educación regular (Inicial, Primaria y Secundaria Comunitaria) y educación alternativa-técnica ocupacional. Con este proyecto se beca a 90-95 menores y jóvenes de escasos recursos de la zona.', 'FMA', '1', 'BOL', '250', NULL, NULL, NULL, NULL, NULL, 45, NULL, NULL, 1, NULL, NULL, 28568.51, 0, 0, 0, 0, 0, 0, 12, '2020-01-01 00:00:00', '2020-12-31 00:00:00', '2020-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situation through the sponsorship program.', 15, 316, 5, 'INF', 6, NULL, 1, 1, 1, 'EDU', 'FOR', 110, 95, 48, 47, NULL, NULL, NULL, 6, 6, NULL, 'El 27 oct enviaron las 1º cartas del año. 6 de nov enviaron las cartas de Nav. Envia las cartas ordenadas y con los datos muy claros, los sobres vienen con el código y nombre del ahijado y padrino. Las cartas tienen dibujos, la letra es clara, se leen bien.', 0, 4, 20, 0),
(2520, 'MS', 'BO/005/20/AM', 1, 'BO_05_20_AM', NULL, 'AM', 'BO', 'Itocta, Cochabamba', 2020, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'El Centro de Acogida \"Hogar María Auxiliadora\" da servicio de acogida y becas de estudio a menore y jóvenes estudiantes de bajos recursos procedentes de familias desestructuradas. Actualmente está atendido por las Hijas del Divino Salvador.', 'HDS', '1', 'BOL', '237', NULL, NULL, NULL, NULL, NULL, 2270, NULL, NULL, 1, NULL, NULL, 10958.24, 10958.24, 0, 0, 0, 0, 0, 12, '2020-01-01 00:00:00', '2020-12-31 00:00:00', '2020-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situation through the sponsorship program', 15, 316, 5, 'INF', 6, NULL, 1, 1, 1, 'EDU', 'FOR', 110, 42, 42, 0, NULL, NULL, NULL, 6, 6, NULL, 'Recibido el Formulario del proyecto, Anexo 2 (hay una apadrinada de 23 años) y carta de abril\r\nFalta acuerdo de colaboración. Se lo he pedido 25 de mayo. Envía confirmación de las cantidades recibidas en diciembre. Guardado en su carpeta.', 0, 4, 20, 0);
