(2891, 'MS', 'BO/002/21/AM', 1, 'BO_02_21_AM', NULL, 'AM', 'BO', 'Santa Cruz de la Sierra (Hogar Don Bosco)', 2021, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'Atiende a niños, adolescentes y jóvenes que son acogidos de manera institucional o temporal en Hogar Don Bosco y Centro Barrio Juvenil de familias desintegradas o están en condiciones de abandono u orfandad. Se cubren necesidades básicas\r\ntotal o parcial', 'SDB', NULL, 'BOL', '255', NULL, NULL, NULL, NULL, NULL, 1284, NULL, NULL, 1, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 12, '2021-01-01 00:00:00', '2021-12-31 00:00:00', '2021-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situations through the sponsorship program.', 15, 316, 4, 'INF', 6, NULL, 0, 1, 1, 'EDU', 'FOR', 110, 28, 0, 28, NULL, NULL, NULL, 6, 6, NULL, NULL, 0, 4, 20, 0),
(2892, 'MS', 'BO/003/21/AM', 1, 'BO_03_21_AM', NULL, 'AM', 'BO', 'Puerto Carabuco, La Paz', 2021, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'Modal\'idad de Educaci6n Alternat.iva en el Mun.ic.lp.io de Carabuco. Una Educaci6n lternativa para mujeres y varones, para niFios, j6venes y adultos, que requieren oportunidades para desarrollar sus capacidades humanist.ico tecnicas.', 'FMA', NULL, 'BOL', '250', NULL, NULL, NULL, NULL, NULL, 4434, NULL, NULL, 1, NULL, NULL, NULL, NULL, 0, 0, NULL, NULL, 0, 12, '2021-01-01 00:00:00', '2021-12-31 00:00:00', '2021-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situations through the sponsorship program.', 15, 316, 4, 'INF', 6, NULL, 0, 1, 1, 'EDU', 'FOR', 110, 77, 26, 51, 'Los niF\\os y j6venes que asisten al Centro, prov.ienen de familias de escasos recursos econ6m.icos, pobres en todo sentido. Son h.ijos de agricultores, pesqueros… familias pobres.', NULL, NULL, 6, 6, NULL, 'Formulario del Proyecto completo. A primeros de año 2021 la Responsable Inés Morales la destinan a Brasil y sigue en su lugar Elisabeth Meneses', 0, 3, 3, 0),
