(2896, 'MS', 'BO/006/21/AM', 1, 'BO_06_21_AM', NULL, 'AM', 'BO', 'Sucre', 2021, 'Acceso a la educación a menores y jóvenes en situación vulnerable a través del apadrinamiento', 'La Unidad Educativa “Domingo Savio” acoge el nivel inicial, para niños de 4 y 5 años de edad, el nivel primario de 6 a 11 años y el nivel secundario que abarca desde los 12 hasta los 17 años. Y por la tarde, funciona la formación técnica.', 'FMA', NULL, 'BOL', '259', 2891, NULL, NULL, 'inspectoria@sdb.bo', '(+04)-4256142', 7265, NULL, NULL, 1, NULL, NULL, NULL, NULL, 0, 0, 0, 0, 0, 12, '2021-01-01 00:00:00', '2021-12-31 00:00:00', '2021-12-31 00:00:00', 0, 0, NULL, 'Access to education for minors and young people in vulnerable situation through the sponsorship program.', 15, 316, 4, 'INF', 6, NULL, 0, 1, 1, 'EDU', 'FOR', 110, 98, 48, 50, 'Los niños y jóvenes que vienen al colegio, la mayoría tiene una situación vulnerable, pero mucho más los que están dentro del proyecto. Las familias son de bajos recursos económicos pero con gran esperanza de ver a sus hijos mejor que ellos.', NULL, NULL, 6, 6, NULL, 'La hermana Nancy Conde 7265 sustituye a Maura Mamani 5957, CONFIRMADO, HAY QUE HACER CAMBIO EN GESDON y necesita código para las dos misiones.', 0, 4, 20, 0),
