INSERT INTO `sectores` (`cod_sector`, `nom_sector`, `nom_sectorIng`, `sector_cad`, `explicacion`, `explicacionIng`) VALUES
(1, 'Educación', 'Education', NULL, 'Alfabetización, Primaria, Secundaria, Formación Profesional, Educación infantil y Enseñanza superior. Proyectos de formación del profesorado y otros recursos humanos educativos, de mejora curricular, de mejora de instalaciones educativas, etc.', NULL),
(2, 'Protección infancia y juventud', NULL, NULL, 'Reinserción de menores y jóvenes en alto riesgo. Menores y jóvenes afectados por la trata, explotación, abusos sexuales, acusados de brujería, castigos tradicionales, torturas, maltrato psicológico.... así como programas especiales para huérfanos, discapacitados, niños abandonados. Lucha contra el trabajo infantil (162) Niños excombatientes: apoyo a la desmovilización, reinserción y reintegración (DDR) de los niños soldados (15261)', NULL),
(3, 'Salud básica, nutrición y seguridad alimentaria', NULL, NULL, 'Programas de asistencia sanitaria básica; servicios de enfermería; suministro de medicamentos y vacunas. Programas para la alimentación (materna, infantil, escolar y familiar); identificación de deficiencias nutritivas; enseñanza de la nutrición y de la higiene alimentaria.  Suministro de productos para la alimentación humana al amparo de programas nacionales o internacionales, con inclusión de los costes de transporte; pagos en metálico para la adquisición de alimentos; ayuda alimentaria para proyectos.', NULL),
(4, 'Agua y saneamiento ', NULL, NULL, 'Suministro de agua y saneamiento: Pozos, letrinas, dotación agua potable, normalmente en Comunidades Rurales', NULL),
(5, 'Infraestructuras sociales', NULL, NULL, 'Viviendas de bajo coste y construcciones sociales, de cultura y ocio (160).   Electrificación (230) (energías alternativas para la comunidad)', NULL),
(6, 'Empleo y generación de ingresos', NULL, NULL, 'Programas de creación de empleo y generación de ingresos; actividades generadoras de ingresos, microemprendimientos, cooperativas, etc. \r\n(Incluye proyectos Productivos sean Agrícolas/Ganaderos (311),\r\n Forestal (312), Pesca (313), \r\nIndustria (incluida la artesanal (321), Industrias extractivas (322), Construcción (323),  Turismo (332) y Multisectorial (400)', NULL),
(7, 'Acción Humanitaria', NULL, NULL, 'Actividades de prevención, mitigación, asistencia, socorro, protección y reconstrucción, así como las labores de defensa de los derechos humanos, testimonio, denuncia, presión política y acompañamiento (720), orientadas a aliviar el sufrimiento, garantizar la subsistencia, proteger los derechos de las personas víctimas de desastres y conflictos armados, desplazados, refugiados y reducir su vulnerabilidad (700)', NULL),
(8, 'Fortalecimiento Institucional', NULL, NULL, 'Fortalecimiento de capacidades de nuestras entidades Socias Locales y alianzas con otras organizaciones del Tercer Sector.. Incluye formación del personal de nuestras entidades Socias. También el apoyo a gastos de funcionamiento de las entidades Socias Locales, compra de vehículos para la sede; así como gastos de construcción y equipamiento de las sedes de la entidad Socia Local que no esté incluida en los sectores anteriores.', NULL),
(9, 'Educación para una ciudadanía global ', NULL, NULL, 'Educación para la ciudadanía y la transformación social, para promover el desarrollo inclusivo, equitativo y sostenible, mediante la educación para el desarrollo sostenible y la adopción de estilos de vida sostenibles, los derechos humanos, la igualdad entre los géneros, la promoción de una cultura de paz y no violencia, la ciudadanía mundial y la valoración de la diversidad cultural y de la contribución de la cultura al desarrollo sostenible.\r\nPromoción de los derechos humanos, el activismo, la movilización, la sensibilización pública y educación en derechos humanos.\r\nIncluye también las Campañas de Sensibilización y otras acciones de animación misionera (museo y otros…)', NULL),
(10, 'Pastoral', NULL, NULL, 'Apoyo a las Parroquias, cursos religiosos y otras actividades de pastoral. (Incluye construcción, equipamiento y actividades en Parroquias)', NULL),
(11, 'Otros', NULL, NULL, 'Cuando no es posible en el resto. Otros multisectorial (Resto de sectores de la lista completa Sectores CAD)', NULL);
